import React from 'react'

export const Upcoming = () => {
    return (
        <div className="upcomingContainer">
            <h3>Upcoming Posts</h3>
            <ul>
                <li>Coffee</li>
                <li>Tea</li>
                <li>Milk</li>
            </ul>
        </div>
    )
}
